$(document).ready(function(){$("*[data-autocomplete-url]").each(function(){var n=$(this).data("label-member"),t=$(this).data("value-member"),i=$(this).data("autocomplete-url");$(this).autocomplete({source:function(r,u){$.ajax({url:i,data:{term:r.term},success:function(i){u($.map(i,function(i){return{label:i[n],value:i[t]}}))}})},select:function(n,t){n.preventDefault();$(this).val(t.item.label);$("#"+$(this).data("value-input")).val(t.item.value)},focus:function(n,t){n.preventDefault();$(this).val(t.item.label)}})})});